    element.classList.toggle("ty");
}

const LetMeKnow = () => {
    return (
        <div className="igo" id="lmk" onClick={IGonnaGo}>
            <div className="content__igo">
                <div className="ic">
                    <div className="hand"></div>
                    <div className="hand2"></div>
                </div>
                <div className="text">
